function AutoSuggestRegionController(inputTextSelector,resultListSelector,onClickRegion){$(inputTextSelector).keyup(function(){var searchTerm=$(inputTextSelector).val().trim();if(0==searchTerm.length)return void $(resultListSelector).slideUp(100);var apiController=new ApiController;apiController.getAutoCompleteNameSuggestions(searchTerm,function(data){var regionList=$(resultListSelector);if(0==data.options.length)return void regionList.slideUp(100);var items=data.options.map(function(item){return"<li>"+item.text+"</li>"});regionList.html(items.join("")),$(resultListSelector+" li").click(function(){var region=data.options[$(this).index()].text;onClickRegion&&onClickRegion(region)}),regionList.slideDown(100)})})}